import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <div className="App">
          <h1>Hello world</h1>
        </div>
      </Routes>
    </Router>
  );
}

export default App;
